const CustomInput = ({ContainerStyles, placeholder, value, onChange, required, InputStyles, IconBefore, IconAfter}) => {
    return (
        <div className={`${ContainerStyles} flex items-center border-[1.5px] border-[#348345] rounded h-[40px] w-[100%]`}>
        <>
            {IconBefore && <IconBefore className='h-[100%] bg-slate-500' style={{fontSize: 20}}/>}
        </>
            {/* <input
                placeholder={placeholder}
                value={value}
                onChange={onChange}
                required={required}
                className={`${InputStyles} w-[100%] h-[100%] rounded`}
            /> */}
            {IconAfter && <IconAfter/>}
        </div>
    )
}

export default CustomInput
